import React,{useState,useEffect} from 'react'
import AxiosRequest from '../../axios'


const CartDetails = () => {

    const [cartData,setCartData] = useState([])

    const retrieveCart = async() => {
        const cartData = await AxiosRequest.get(`/shareme/cart/1`)
                        .then((res) => {
                            console.log(res.data);
                            setCartData(res.data)
                        })
                        .catch((err) => {console.log(err)})
    }

    console.log(cartData)
    const RenderCartData = cartData.map((each) => {
        console.log(each);
        return(
            <div className='col-md-5' style={{backgroundColor:"white", borderRadius:"25px",margin:"25px",padding:"25px"}} key={each.id} >
                <p className='lead'>{each.title}</p>
                <div className='d-flex'></div>
                <p>NetPrice:{each.net_price}</p>
                <p> Quantity: {each.quantity}</p>
            </div>
        );
    })


    useEffect(() => {
      retrieveCart();


    }, [])



    return (
    <div align="center">
        <h1 className='display-6'>Cart Details</h1>
        {RenderCartData}
    </div>
  )
}

export default CartDetails;
